import logo from "./logo.svg";
import "./App.css";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import DetailBooking from "../src/page/detailBooking";

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/bookings/thisweek">
          <DetailBooking />
        </Route>
        <Route path="/bookings/thisweek/:roomId">
          <DetailBooking />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
